import '../styles/navbar.css';

function Navbar() {
  return (
    <>
    <nav>
        <ul>
            <li>About</li>
            <li>Timeline</li>
            <li>Skills</li>
            <li>Projects</li>
            <li>Contact</li>
        </ul>
    </nav>
    </>
  );
}

export default Navbar;
